['#include<bits/stdc++.h>
#define ll long long
using namespace std;
int solve(vector<ll> v, int l, int h, ll val){
	while(l < h){
		int mid = (l + h) / 2;
		if(val < v[mid] * v[mid] + v[mid]){
			h = mid;
		}else{
			l = mid + 1;
		}
	}
	return l;
}
int main(){
	ios_base::sync_with_stdio(false);
	cin.tie(0);
	#ifndef ONLINE_JUDGE
		freopen("input.txt", "r", stdin);
		freopen("output.txt", "w", stdout);
	#endif
  ll n, k;
  cin >> n >> k;
  vector<ll> v;
  for(int i=1; i<=n; i++)
  	v.push_back(i);
  ll ans = solve(v, 0, n, (2 * k + 2 * n)); 
  cout << n - ans << endl;
	return 0;
}']

