['#include <bits/stdc++.h>

using namespace std;

map <int,int> bucket;
int unos[10000];

int calculateSets(int n){
    if(n %2 == 0){ return n/2; }
    else{ return (n/2)+1; }
}

int main(){
    int n,k;
    scanf("%d%d",&n,&k);
    int setDrinks = calculateSets(n);

    for(int i=0; i<n; i++){
        int a;
        scanf("%d",&a);
        bucket[a]++;
    }
    int totalStudents = 0;
    int pos = 0;
    int setX = 0;
    for(pair <int,int> a : bucket){
        if(a.second%2==0){
            setX += a.second/2;
        }
        else if(a.second%2!=0 and a.second>1){
            unos[pos] = 1;
            setX += a.second/2;
            pos++;
        }
        else if(a.second == 1){
            unos[pos] = 1;
            pos++;
        }
    }
    if(setX >= setDrinks){
        printf("%d",n);
        return 0 ;
    }
    totalStudents += setX*2;
    setDrinks -= setX;
    for(int i=0; i<pos; i++){
        if(setDrinks>0){
            totalStudents++;
            setDrinks--;
        }
    }
    printf("%d",totalStudents);
    return 0;
}
